Dynamically renders a Bootstrap grid ensuring that a new Row is used once the column width exceeds 12. This helps to
avoid wrapping issues and also can handle having components with various widths.


@param items
 The contents of the grid. Items should have an attribute of "width", otherwise the defaultWidth is used.
@param render
 The render function for the contents of the column. This behaves like the map function over `items`. The render
 function has the signature `render(item, index)`.
@param defaultWidth
 The default width of a column should the item not specify one.
@param className
@param style

This is a simpler version of the Dynamic row.

